import { baseUrl } from "../constants";

const getAll = () => {
    fetch(`${baseUrl}/entries`)
    .then((res) => {
        console.log(res);
    })
    .catch((err) => {
        throw new Error(err);
    });
}

export const entriesService = { getAll };
